import React, { useEffect, useState } from 'react';
import axios from 'axios';

function RecruiterDashboard() {
  const [applicants, setApplicants] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8080/api/recruiter/applicants', { withCredentials: true })
      .then(res => setApplicants(res.data))
      .catch(() => alert('Failed to fetch applicants'));
  }, []);

  return (
    <div>
      <h2>Applicants</h2>
      <ul>
        {applicants.map(app => (
          <li key={app.id}>{app.name} - {app.graduation} <a href={`http://localhost:8080/resumes/${app.resume}`} download>Download Resume</a></li>
        ))}
      </ul>
    </div>
  );
}

export default RecruiterDashboard;
